How to return embedded document with ID of<p>I have a MongoDB collection with an example document like this:</p>

<p><a href="https://i.stack.imgur.com/Jmjn0.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/Jmjn0.png" alt="Mongo example document"></a></p>

<p>What I want to do (as you can see from the actual code) is to update a <code>role</code> field in <code>members.x.role</code> where <code>members.x.id</code> equals given ID (ID is UUID so it's unique; this part of code works without problem) and then I want to return that <code>members.x</code>. But the problem is that it always returns first member instead of the one that has been just updated. I've tried some methods of <em>mgo</em> and found <code>Distinct()</code> be closest to my expectations, but that doesn't work as I want.</p>

<p>My question is how can I return <code>member</code> <strong><em>embedded document</em></strong> with specified ID?</p>

<p>I've already looked on <a href="https://stackoverflow.com/questions/9201743/mongodb-select-field-to-return-embedded-document-in-array">this</a> and <a href="https://stackoverflow.com/questions/33751451/how-can-i-use-mongodb-projections-with-go-and-mgo">this</a> but it didn't help me.</p>

<pre><code>func (r MongoRepository) UpdateMemberRole(id string, role int8) (*Member, error) {
    memberQuery := &amp;bson.M{"members": &amp;bson.M{"$elemMatch": &amp;bson.M{"id": id}}}
    change := &amp;bson.M{"members.$.role": role}

    err := r.db.C("groups").Update(memberQuery, &amp;bson.M{"$set": &amp;change})
    if err == mgo.ErrNotFound {
        return nil, fmt.Errorf("member with ID '%s' does not exist", id)
    }

    // FIXME: Retrieve this member from query below. THIS ALWAYS RETURNS FIRST MEMBER!!!
    var member []Member
    r.db.C("groups").Find(&amp;bson.M{"members.id": id}).Distinct("members.0", &amp;member)

    return &amp;member[0], nil
}
</code></pre>

