how to get the data according to the data entered in the query string in golang?<p>I'm retrieving the data from the collection in mongodb matches to the data enter in the query string using golang.</p>

<p>There are two cases</p>

<p><strong>case 1</strong></p>

<p>Suppose if user search the single field like <code>first_name</code>, <code>last_name</code> etc. Then the data will be retrieve by hitting the url <code>http://localhost:8080/api/v1/customer?keyword=puneet</code> </p>

<p><strong>case 2</strong></p>

<p>In case 2 suppose we have the two fields in collection of mongodb for example <code>first_name : puneet</code>, <code>last_name : jindal</code>,etc. If the user will enter the two fields in the query string <code>first_name</code> and <code>last_name</code> </p>

<p>Example hitting the url like <code>http://localhost:8080/api/v1/customer?keyword=puneet%20kumar</code> then there is no data retrieval.</p>

<p>I have tried the following  code for this. But not success</p>

<p>Struct for this is:</p>

<pre><code>type Customer struct {
  Id          int    `json:"id" bson:"_id"`
  Name        string `json:"name" bson:"name"`
  FirstName   string `json:"first_name" bson:"first_name"`
  LastName    string `json:"last_name" bson:"last_name"`
  Email       string `json:"email" bson:"email"`
  PhoneNumber string `json:"phone_number" bson:"phone_number"`
}
</code></pre>

<p>Function for retrieving the data:</p>

<pre><code>func GetCustomers(c *gin.Context) {
value:= c.Query("keyword")
fmt.Println(value)
response := ResponseControllerList{}
conditions := bson.M{"$or": []bson.M{
    bson.M{"first_name": bson.RegEx{".*" + value, "i"}},
    bson.M{"last_name": bson.RegEx{".*" + value, "i"}},
    bson.M{"email": bson.RegEx{".*" + value, "i"}},
    bson.M{"phone_number": bson.RegEx{".*" + value, "i"}},
}}
data, err := models.GetCustomerListing(conditions)
if err != nil {
    response = ResponseControllerList{
        config.FailureCode,
        config.FailureFlag,
        config.FailureMsg,
        nil,
        nil,
    }
} else {
    response = ResponseControllerList{
        config.SuccessFlag,
        config.SuccessFlag,
        config.SuccessMsg,
        data,
        nil,
    }
}
GetResponseList(c, response)
}
</code></pre>

